import React from "react";
import MathComfort from "../assets/mathcomfort.png";

const Page3 = ({ progress }) => {
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        marginTop: "50px", // Adjust margin top as needed
      }}
    >
      <div
        style={{
          width: "100%",
          maxWidth: "800px", // Adjust max width as needed
          textAlign: "center",
          padding: "0 20px", // Add some padding
        }}
      >
        <div
          style={{
            display: "flex",
            flexDirection: "column",
            alignItems: "center",
          }}
        >
          <img
            src={MathComfort}
            alt="Math Comfort"
            style={{ marginBottom: "20px", maxWidth: "100%", height: "auto" }}
          />
          <div style={{ textAlign: "left", maxWidth: "400px" }}>
            {" "}
            {/* Adjust max width for the description */}
            <h1 style={{ marginBottom: "10px" }}>You are in the right place</h1>
            <p>
              Description goes here. Lorem ipsum dolor sit amet, consectetur
              adipiscing elit. Sed do eiusmod tempor incididunt ut labore et
              dolore magna aliqua. Ut enim ad minim veniam.
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Page3;
